import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  // fetch api here
  componentDidMount() {
    fetch("http://127.0.0.1:8000/api/test").then(function(response) {
      response.json().then(function(resp) {
        console.log(resp);
      });
    });
  }

  render() {
    return (
      <div className="App">
        <h1>Test api</h1>
      </div>
    );
  }
}

export default App;
